import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Flashcards from '../components/Flashcards'; // Assuming Flashcards component is in the components folder

function Hiragana() {
  const [hiragana, setHiragana] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/api/japanese/characters')
      .then(response => {
        setHiragana(response.data.hiragana); // Assuming 'hiragana' is the array key
      })
      .catch(error => console.error(error));
  }, []);

  return (
    <div>
      <h1>Hiragana Flashcards</h1>
      <Flashcards hiragana={hiragana} katakana={[]} type={hiragana} />
    </div>
  );
}

export default Hiragana;
